import { createStore } from "vuex";

export default createStore({
  state: {},
  getters: {},
  mutations: {},
  actions: {
    getBlogs(){
      var requestOptions = {
        method : "GET",
        headers: "myHeaders", 
        redirect : "follow"
      };

      fetch("https://jsonplaceholder.typicode.com/posts", requestOptions)
      .then(response => response.json())
      .catch(error => console.log("error", error));
    }
  },
  modules: {},
});
